from datetime import datetime
import pandas as pd
import os

def genera_informe(registro, ruta, nombre_archivo):
    # Crear un DataFrame vacío
    df = pd.DataFrame()

    # Agregar los datos del registro al DataFrame
    df = pd.DataFrame([{
        'Orden_Embarque': registro.diccionario['Orden_Embarque'],
        'Instructivo': os.path.basename(registro.diccionario['Archivo']),
        'Agente': registro.diccionario['Operador_Logistico']['Agente'],
        'Naviera': registro.diccionario['Operador_Logistico']['Naviera'],
        'Motonave': registro.diccionario['Operador_Logistico']['Motonave'],
        'Puerto_Embarque': registro.diccionario['Operador_Logistico']['Puerto_Embarque'],
        'Estado': 'OK' if registro.diccionario['Api']['response']['code'] == 200 and registro.diccionario['Api']['response']['message']['success'] else 'NO OK'
    }])

    # Ruta del archivo
    ruta_archivo = f"{ruta}/En Proceso/{nombre_archivo}"

    # Verificar si el archivo ya existe
    if os.path.exists(ruta_archivo):
        # Cargar el archivo existente
        df_existente = pd.read_excel(ruta_archivo)
        # Concatenar los datos nuevos con los existentes
        df = pd.concat([df_existente, df], ignore_index=True)

    # Guardar el DataFrame en un archivo Excel en la ruta especificada
    df.to_excel(ruta_archivo, index=False)

    print(f"Archivo Excel generado y guardado en: {ruta_archivo}")

    return ruta_archivo

